import React, { useRef , useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import eye from "../images/eye.svg";
import eyeHiden from "../images/eye-hiden.svg";
import loginIcon from "../images/login.svg";
import emailIcon from "../images/email.svg";
import errorIcon from "../images/error-icon.svg";

function AuthForm({ onValidation, isError, messageError, title, button}) {
  const [isVisible, setVisible] = useState(false);

  const formRef = useRef();
  const [isValidity, setValidity] = useState(true);

  const [password, setPassword] = useState('');
  const [repeatPassword, setRepeatPassword] = useState('');

  useEffect(() => {
    setValidity(formRef.current.checkValidity());
  }, [isError]);

  const navigate = useNavigate();

  function handleChangeInput(e) {
    onValidation(e);
  }

  function handleClickEye() {
    setVisible(!isVisible);
  }

  return (
    <div className="auth">
      <button className="back-button" onClick={() => navigate("/")}></button>
      <h1 className="auth__title">{title}</h1>
      <form
        className="auth__form"
        ref={formRef}
        name={`auth-form`}
        noValidate
      > 
        <div className="inputs-container">
          <input
            className={`auth__input ${isError.email && "auth__input_type_error"}`}
            type="email"
            placeholder="Эл. почта"
            name="email"
            onChange={handleChangeInput}
            required
          />
          {isError.email && <img className="auth__input-error-image" src={errorIcon} alt="Иконка ошибки"/>}
          <img className="auth__input-image" src={emailIcon} alt="Иконка логина"/>
          <span
          className={`auth__input-error ${
            isError.email && "auth__input-error_active"
          }`}
        >
          {isError.email && messageError.email}
          </span>
        </div>
        <div className="inputs-container">
          <input
            className={`auth__input ${isError.login && "auth__input_type_error"}`}
            type="text"
            placeholder="Логин"
            name="login"
            minLength="3"
            onChange={handleChangeInput}
            required
          />
          {isError.login && <img className="auth__input-error-image" src={errorIcon} alt="Иконка ошибки"/>}
          <img className="auth__input-image" src={loginIcon} alt="Иконка логина"/>
          <span
          className={`auth__input-error ${
            isError.login && "auth__input-error_active"
          }`}
        >
          {isError.login && messageError.login}
          </span>
        </div>
        <div className="inputs-container">
          <input
            className={`auth__input ${isError.password && "auth__input_type_error"}`}
            type={isVisible ? "text" : "password"}
            placeholder="Пароль"
            name="password"
            minLength="3"
            onChange={(e) => {handleChangeInput(e); setPassword(e.target.value)}}
            required
          />
          {isError.password && <img className="auth__input-error-image" src={errorIcon} alt="Иконка ошибки"/>}
          <img onClick={handleClickEye} className="auth__input-image" src={ isVisible ? eye : eyeHiden} alt={isVisible ? "Пароль показан" : "Пароль скрыт"}/>
          <span
          className={`auth__input-error ${
            isError.password && "auth__input-error_active"
          }`}
        >
          {isError.password && messageError.password}
          </span>
        </div>
        <div className="inputs-container">
          <input
            className={`auth__input ${isError.repeatPassword && "auth__input_type_error"}`}
            type={isVisible ? "text" : "password"}
            placeholder="Повторите пароль"
            name="repeatPassword"
            minLength="3"
            onChange={(e) => {handleChangeInput(e); setRepeatPassword(e.target.value)}}
            required
          />
          {isError.repeatPassword && <img className="auth__input-error-image" src={errorIcon} alt="Иконка ошибки"/>}
          <img onClick={handleClickEye} className="auth__input-image" src={ isVisible ? eye : eyeHiden} alt={isVisible ? "Пароль показан" : "Пароль скрыт"}/>
          <span
          className={`auth__input-error ${
            (isError.repeatPassword || !(password === repeatPassword)) && "auth__input-error_active"
          }`}
        >
          {(isError.repeatPassword && messageError.repeatPassword) || ((!(repeatPassword === '') && !(password === repeatPassword)) && "Пароли не совпадают")}
          </span>
        </div>
        <button
          disabled={!isValidity || (!(password === repeatPassword))}
          type="submit"
          className={`button wellcome__button ${
            (!isValidity || (!(password === repeatPassword))) && "button_disabled"
          }`}
        >
          {button}
        </button>
      </form>
      <p className="auth__text">Уже есть аккаунт? <Link to="/sign-in" className="auth__link">Войти</Link></p>
    </div>
  );
}

export default AuthForm;
